import React from 'react';
import FlipCard from '../Cards/FlipCard';
import ProfileBack from '../Cards/Profile/ProfileBack';
import ProfileFront from '../Cards/Profile/ProfileFront';
import AsideMenu from '../Menus/AsideMenu';

const Aside = () => {
    return (
        <div class="container">
            <div class="logo">
                <img src="" />
            </div>
            <div class="profile">
                <FlipCard frontContent={<ProfileFront title="FRONT" image="../Image/Profile.png"/>} backContent={<ProfileBack title="BACK" image=""/>}  />
            </div>
            <div class="menu">
                <AsideMenu />
            </div>
        </div>
    );
}

export default Aside;
